import React, { useEffect } from "react";
import { useSelector } from "react-redux";

const Songs = () => {
  const currArtist = useSelector((state) => state.artist.currArtist);
  const songsList = currArtist.songs;
  useEffect(() => {}, []);
  return <div></div>;
};

export default Songs;
